  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is output from the Sea Level
  Affecting Marshes Model (SLAMM) for the South Atlantic Migratory Bird Initiative
  (SAMBI) geographic planning region. It represents 10 year increments (ranging from
  year 2000 - year 2100) for the climate change scenario A1B, A1FI, A2, or B1. The
  dataset was developed as one component for modeling landscape scale alterations
  of avian habitats due to climate change. It may also be used as a stand-alone product
  to illustrate potential changes in marsh and coastal environments due to longterm
  sea level rise. Model outputs from SLAMM are subject to constraints of the modeling
  process itself. The Biodiversity and Spatial Information Center (BaSIC) did not
  create the SLAMM modeling approach and/or algorithims. However, all effort was made
  to ensure data inputs required by the model are of the highest quality. Certain
  input parameters may need to be altered to create a more reliable model projection.
  BaSIC is currently (January 2010) working with cooperators to address such issues.
  Clough, J. S. 2008. SLAMM 5.0.1. Technical documentation and executable program
  downloadable from http://www.warrenpinnacle.com/prof/SLAMM/index.html\",\n\t\"license_title\":
